import Center from './Center'
import CenterMobile from './CenterMobile';
import Footer from './Footer'
import { Routes, Route,Navigate} from "react-router-dom";
import Admin from './admin/Admin'
import NotFound from './NotFound'


import Book from "./admin/Book";
import Quran from "./admin/Quran";
import Subject from "./admin/Subject";

let Md = 992;

function App() {
  return (
    <>
      <Routes>
        <Route
          path="/"
          element={Md > window.outerWidth ? <CenterMobile /> : <Center />}
        />
        <Route path="/admin" element={ <navigate  to=""/> }>
          <Route path="book" element={<Book />} />
          <Route index path="quran" element={<Quran />} />
          <Route path="subject" element={<Subject />} />
        </Route>
        <Route path="*" element={<NotFound />} />
      </Routes>

      <Footer />
    </>
  );
}

export default App;
